import * as React from "react";

const PendingIcon = () => {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 50 50">
     <circle cx="25" cy="25" r="25" fill="#ffa12e"/>
     <rect x="23.26" y="10.93" width="3.43" height="19.54" rx="0.41" fill="#fff"/>
     <rect x="23.17" y="34.87" width="3.59" height="3.79" rx="0.41" fill="#fff"/>
    </svg>
  );
};

export default PendingIcon;
